import { Routes, Route } from "react-router-dom";
import CreatePage from "./Pages/CreatePage";
import HomePage from "./Pages/Home";

function App() {
    return (
        <div className="app">
            <Routes>
                <Route path="/">
                    <HomePage />
                </Route>
                <Route path="/add">
                    <CreatePage />
                </Route>
            </Routes>
        </div>
    );
}

export default App;
